    def test_ewithalteredvalue_distinct(self):
        xs = EVar("xs").with_type(TBag(THandle("H", INT)))
        x = EVar("x").with_type(xs.type.t)
        e = EUnaryOp(UOp.Distinct, EMap(xs, ELambda(x, EWithAlteredValue(x, EBinOp(EGetField(x, "val"), "+", ONE)))))
        assert retypecheck(e)
        self.check_ewithalteredvalue(e)

